import React, { Component } from "react";
class Centers extends Component {
  state = {
    centers: [],
    currentPage: 1,
    pageSize: 4,
    searchQuery: "",
    sortColumn: { path: "title", order: "asc" },
  };
  render() {
    return <h1>Tata</h1>;
  }
}

export default Centers;
